import React from 'react';
import '../css/SpacecraftsList.css';
import { useNavigate } from 'react-router-dom';

const SpacecraftList = ({pictureUrl, name, capacity, key, showSpaceshipDetails}) => {
    return (
        <div className="container" onClick={() => showSpaceshipDetails(key)}>
          <div>
            <img src={`${pictureUrl}`}/>
          </div>
          <p className="info">Name: {`${name}`}</p>
          <p className="info">Capacity: {`${capacity}`}</p>
          <button>Destroy</button>
        </div>
    )
}

export default SpacecraftList;
